import React,{useEffect,useState} from 'react';
import { Box,colors } from '@mui/material';

import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';

 
export default  function Auth_reg (props){

    if(props.IsAuth){
    return(
        <div className='AuthPage'>
<TextField
                error={EmailError}
                id="Email_Field"
                label="Почта"
                defaultValue={props.UserEMail}
                helperText="Введите новую почту"
                margin="dense"
            />
            <br/>
            <TextField
                error={OldPasswdError}
                id="old_passwd"
                label="Старый пароль"
                type="password"
                helperText="Введите старый пароль"
                margin="dense"
               
            />
            <br/>
            <TextField
                error={NewPasswdError1}
                id="new_passwd_1"
                label="Новый пароль"
                type="password"
                helperText="Введите новый пароль"
                margin="dense"
            />
            <br/>
            <TextField
                error={NewPasswdError2}
                id="new_passwd_2"
                label="Ещё раз"
                type="password"
                helperText="Повторите новый пароль"
                margin="dense"
            />
            <br/>
            <Button variant="contained" >Сохранить изменения</Button>
        </div>
    );
}
}
